/*@import url('https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.2/css/all.min.css');*/

div#page-ctn{
	max-width: 100%!important;  /* Setzt die maximale Breite des Inhalts auf 100% */
	margin: 0 auto;   /* Zentriert den Inhalt */
	padding: 1rem;    /* Fgt bei Bedarf etwas Padding hinzu */
	background-color: white;
}

table{
	border-spacing:0px;
}
tbody tr:nth-child(even){
	background-color:lavender;
}
tr:first-child :is(th){
	background-color:indigo;
	color:white;
}
th, td {
	padding: 1em;
}
h3{
	background-color:maroon;
	color:ivory;
}

svg[id^="mermaid"] {
	--clusterBackground: ghostwhite;
	--clusterStrokeColor: indigo;
	--clusterTextColor: indigo;
	--nodeBackground:darkviolet;
	--strokeColor: indigo;
	--textColor:white;
	--edgeLabelBackground: Black;
	--edgeLabelStrokeColor: Black;
	--edgeLabelTextColor: Ivory;
}
/* 
* flowchart.css
* tested with mermaid 11.12
*/
svg[id^="mermaid"].flowchart .cluster rect {fill:var(--clusterBackground)!important;stroke:var(--clusterStrokeColor)!important;}
svg[id^="mermaid"].flowchart .cluster text {fill:var(--clusterTextColor)!important;}
svg[id^="mermaid"].flowchart .cluster .nodeLabel {color:var(--clusterTextColor)!important;}
svg[id^="mermaid"].flowchart .cluster .nodeLabel p {font-size:10px;}
svg[id^="mermaid"].flowchart .node :is(rect, circle, path) {fill:var(--nodeBackground)!important;stroke:var(--strokeColor)!important;}
svg[id^="mermaid"].flowchart .node text {fill:var(--textColor)!important;}
svg[id^="mermaid"].flowchart .node .text + .label text {fill:var(--nodeBackground)!important;}
svg[id^="mermaid"].flowchart .node :is(rect).text {fill:none!important;}
svg[id^="mermaid"].flowchart .node .nodeLabel{color:var(--textColor)!important;}
svg[id^="mermaid"].flowchart .edgePaths path {stroke:var(--strokeColor)!important;}
svg[id^="mermaid"].flowchart .edgeLabel {color:ivory!important;background-color:black!important;}
svg[id^="mermaid"].flowchart .edgeLabel p {background-color:var(--edgeLabelBackground)!important;font-size:10px;}
svg[id^="mermaid"].flowchart .edgeLabel text {fill:var(--edgeLabelTextColor)!important;}
svg[id^="mermaid"].flowchart .edgeLabel rect {fill:var(--edgeLabelBackground)!important;stroke:var(--edgeLabelStrokeColor)!important;opacity:1!important;}
svg[id^="mermaid"].flowchart .marker {fill:var(--strokeColor)!important;stroke:var(--strokeColor)!important;}
svg[id^="mermaid"].flowchart .marker circle {fill:var(--strokeColor)!important;stroke:var(--strokeColor)!important;}
svg[id^="mermaid"] {
	--ganttSection0: Slateblue;
	--ganttSection1: Lavender;
	--ganttSection2: Darkred;
	--ganttSectionTitleColor: Indigo;
	--ganttSectionTitleFontSize: 10px;
	--ganttTextFontSize: 10px;
	--ganttTitleTextColor: indigo;
	--ganttTitleTextFontSize: 18px;
	--gantExcludeColor: Lightgrey;
	--ganttMilestoneFill: Darkviolet;
	--ganttMilestoneStroke: Indigo;
	--ganttTaskFill: Darkviolet;
	--ganttTaskStroke: Indigo;
	--ganttTaskTextColor: White;
	--ganttActiveStroke: Indigo;
	--ganttActiveFill: Ivory;
	--ganttActiveTextColor: Indigo;
	--ganttDoneStroke: Indigo;
	--ganttDoneFill: Thistle;
	--ganttDoneTextColor: Indigo;
	--ganttCritFill:Crimson;
	--ganttCritStroke:Darkred;
	--ganttTaskTextOutsideColor:Indigo;
	--ganttLinkColor: Skyblue;
	--ganttLinkDecoration: underline;
	--ganttTickLine: Indigo;
	--ganttTickTextColor: Indigo;
}
/*
* gantt.css
*/
svg[id^="mermaid"] .section0 {fill:var(--ganttSection0)!important;}
svg[id^="mermaid"] .section1 {fill:var(--ganttSection1)!important;}
svg[id^="mermaid"] .section2 {fill:var(--ganttSection2)!important;}
svg[id^="mermaid"] text {font-size:var(--ganttTextFontSize)!important;}
svg[id^="mermaid"] .titleText {fill:var(--ganttTitleTextColor)!important; font-size:var(--ganttTitleFontSize)!important}
svg[id^="mermaid"] .sectionTitle, .sectionTitle0, .sectionTitle2, .sectionTitle3   {fill:var(--ganttSectionTitleColor)!important; font-size:var(--ganttSectionTitleFontSize)!important;}
svg[id^="mermaid"] .exclude-range {fill:var(--gantExcludeColor)!important;}
svg[id^="mermaid"] .task, .task0, .task1, .task2 {stroke:var(--ganttTaskStroke)!important;fill:var(--ganttTaskFill)!important;}
svg[id^="mermaid"] .milestone{stroke:var(--ganttMilestoneStroke)!important;fill:var(--ganttMilestoneFill)!important;}
svg[id^="mermaid"] .crit0, .crit1, .crit2 {stroke:var(--ganttCritStroke)!important;fill:var(--ganttCritFill)!important;}
svg[id^="mermaid"] .active0, .active1, .active2 {stroke:var(--ganttActiveStroke)!important;fill:var(--ganttActiveFill)!important;}
svg[id^="mermaid"] .done0, .done1, .done2 {stroke:var(--ganttDoneStroke)!important;fill:var(--ganttDoneFill)!important;}
svg[id^="mermaid"] .taskText {fill:var(--ganttTaskTextColor)!important;}
svg[id^="mermaid"] .taskText0, .taskText1, .taskText2 {fill:var(--ganttTaskTextColor)!important;}
svg[id^="mermaid"] .critText0, .critText1, .critText2{fill:var(--ganttTaskTextColor)!important;}
svg[id^="mermaid"] .activeText0, .activeText1, .activeText2{fill:var(--ganttActiveTextColor)!important;}
svg[id^="mermaid"] .doneText0, .doneText1, .doneText2{fill:var(--ganttDoneTextColor)!important;}
svg[id^="mermaid"] .taskTextOutside0, .taskTextOutside1, .taskTextOutside2 {fill:var(--ganttTaskTextOutsideColor)!important;}
svg[id^="mermaid"] .milestoneText{fill:var(--ganttTaskTextOutsideColor)!important;}
svg[id^="mermaid"] .taskText.clickable{fill:var(--ganttLinkColor)!important; text-decoration:var(--ganttLinkDecoration)!important;}
svg[id^="mermaid"] .tick line, today{stroke:var(--ganttTickLine)!important;}
svg[id^="mermaid"] .tick text{fill:var(--ganttTickTextColor)!important;}
/*
* mindmap
*/
