	.section-edge-4{fill:var(--mm_s4Fill)!important;stroke:var(--mm_s4Fill)!important;}
	.section-4 line{stroke:var(--mm_lineStroke)!important;}
	.section-5 text{fill:var(--mm_lightTextColor)!important;}
	.section-5 :is(rect,polygon,circle,path){fill:var(--mm_s5Fill)!important;stroke:var(--mm_rootStroke)!important;}
	.section-edge-5{fill:var(--mm_s5Fill)!important;stroke:var(--mm_s5Fill)!important;}
	.section-5 line{stroke:var(--mm_lineStroke)!important;}
	.section-6 text{fill:var(--mm_darkTextColor)!important;}
	.section-6 :is(rect,polygon,circle,path){fill:var(--mm_s6Fill)!important;stroke:var(--mm_rootStroke)!important;}
	.section-edge-6{fill:var(--mm_s6Fill)!important;stroke:var(--mm_s6Fill)!important;}
	.section-6 line{stroke:var(--mm_lineStroke)!important;}
	.section-7 text{fill:var(--mm_lightTextColor)!important;}
	.section-7 :is(rect,polygon,circle,path){fill:var(--mm_s7Fill)!important;stroke:var(--mm_rootStroke)!important;}
	.section-edge-7{fill:var(--mm_s7Fill)!important;stroke:var(--mm_s7Fill)!important;}
